import { FunctionComponent, useState, useEffect } from "react";
import styles from "./LabRegistrationForm.module.css";
import axios from "axios";
import { useDispatch, useSelector } from 'react-redux';
import { setTimezone } from '../store/timezoneSlice';
import { RootState } from '../store/store';
//const SERVER_URL =  process.env.REACT_APP_SERVER_URL
//const GET_URL =  SERVER_URL + 'api/'
export type RootType = {
  className?: string;
};

const LabRegistrationForm: FunctionComponent<RootType> = ({
  className = "",
}) => {
  const [formData, setFormData] = useState({
    labName: "",
    providerGroup: "",
    providerUnit: "",
    address: "",
    state: "",
    city: "",
    zipCode: "",
    officePhone: "",
    mobile: "",
    email: "",
    timeZone: "",
  });

  // Initialize the state with an empty array of ProviderGroup
  const [providerGroups, setProviderGroups] = useState<ProviderGroup[]>([]);
  const [providerUnits, setProviderUnits] = useState<ProviderUnit[]>([]);
  const [timezones, setTimezones] = useState<TimeZone[]>([]);

  const dispatch = useDispatch();
  const selectedTimezone = useSelector((state: RootState) => state.timezone.timezone);

const handleRegisterLab = () => {
  dispatch(setTimezone('Pacific Time (UTC-08:00)')); // Example timezone; adjust as necessary
};
  //const [providerUnits, setProviderUnits] = useState([]);
  //const [timezones, setTimezones] = useState([]);
  interface ProviderGroup {
    id: string; // or number, depending on your API data
    provider_group: string;
  }
  interface ProviderUnit {
    id: string; // or number, depending on your API data
    provider_unit: string;
  }
  interface TimeZone {
    id: string; // or number, depending on your API data
    name: string;
    abbreviation:string;
  }
  useEffect(() => {
    const fetchProviderGroups = async () => {
      try {
        const response = await axios.get<ProviderGroup[]>('http://localhost:3005/api/providerGroup');
        //console.log('uks',response.data); // Add this line to check the response
